import Header from './components/Header' //using <Header /> it will add the content from the component
import Footer from './components/Footer'

import HomeScreen from './screens/HomeScreen'

//it is equal to <body>
function App() {
  return (
    <div>
      <Header /> 
      <main className='py-3'>
        <Container>

            <HomeScreen />
        </Container> 
      </main>
      <Footer />
    </div>
  ) 
}

export default App;
